import * as React from 'react';
import Box from '@mui/material/Box';
import AdapterDateFns from '@mui/lab/AdapterDateFns';
import LocalizationProvider from '@mui/lab/LocalizationProvider';
import DesktopDatePicker from '@mui/lab/DatePicker';
import Button from '@mui/material/Button';

export default function CustomInput() {
  const [value, setValue] = React.useState<Date | null | number|any>(new Date());
  const [value1, setValue1] = React.useState<Date | null | number|any>(new Date());

  return (
    <div>
    <LocalizationProvider dateAdapter={AdapterDateFns}>

                    <DesktopDatePicker
                        label="Custom input"
                        value={value}
                        onChange={(newValue:Date|null|number|any) => {
                            setValue(newValue);
                            console.log("V1:",value.getTime()+22)
                            console.log("V1:",value)
                        }}
                        renderInput={({ inputRef, inputProps, InputProps }) => (
                        <Box sx={{ display: 'flex', alignItems: 'center' }}>
                            <input ref={inputRef} {...inputProps} />
                            {InputProps?.endAdornment}
                        </Box>
                        )}
                    />
                    <DesktopDatePicker
                        label="Custom input"
                        value={value1}
                        onChange={(newValue1:Date|null|number|any) => {
                            setValue1(newValue1);
                            console.log("V2:",value1.getTime() + 11)
                            console.log("V2:",value1)
                        }}
                        renderInput={({ inputRef, inputProps, InputProps }) => (
                        <Box sx={{ display: 'flex', alignItems: 'center' }}>
                            <input ref={inputRef} {...inputProps} />
                            {InputProps?.endAdornment}
                        </Box>
                        )}
                    />
    </LocalizationProvider>
    {value-value1 ?  
        <Button variant="contained" color="error"> Error </Button>
        : 
        <Button variant="contained" color="success" sx={{ mt: 1, mb: 2 }}> Submit </Button> 
    }
</div>
  );
}
